import React, { Component } from 'react';
import styles from './App.module.css';
import Navbar from './Navbar/Navbar';
import ContentArea from './ContentArea/ContentArea';
import dummyText from './DummyText';

class App extends Component {
  state = {
    theme: 'dark'
  }

  render() {
    return (
      <div className={styles.App}>
        <Navbar theme={this.state.theme} />
        <ContentArea
          title="Section 1"
          subtitle={dummyText}
          theme={this.state.theme}
          id="section1" />
        <ContentArea
          title="Section 2"
          subtitle={dummyText}
          theme={this.state.theme}
          id="section2" />
        <ContentArea
          title="Section 3"
          subtitle={dummyText}
          theme={this.state.theme}
          id="section3" />
        <ContentArea
          title="Section 4"
          subtitle={dummyText}
          theme={this.state.theme}
          id="section4" />
        <ContentArea
          title="Section 5"
          subtitle={dummyText}
          theme={this.state.theme}
          id="section5" />
      </div>
    );
  }
}

export default App;
